function ParameterSlider({ label, min, max, step = 1 }) {
  
  return (
    <div style={{ margin: "25px 0" }}>
      <label className="option-label-inline">{label}</label>
      <input
        type="range"
        min={min}
        max={max}
        step={step}
      />
    </div>
  );
}

export default ParameterSlider;
